// ==UserScript==
// @name           PLCA.PL QuakeLive ClanWar Monitor
// @namespace      http://plca.pl/
// @description    Shows how many members of each specified clans is online at the moment.
// @author         amaru
// @include        http://*.quakelive.com/*
// @exclude        http://*.quakelive.com/forum*
// @grant          GM_getValue
// @grant          GM_setValue
// @grant          GM_addStyle
// @grant          GM_xmlhttpRequest
// ==/UserScript==

var PLCA = {
	clansArray: [
		'6447',		//nuk3
		'182992',	//vaens
		'189357',	//lg6
		'194588',	//nat
		'181200',	//uvm
		'179654',	//vnm
		'43507',	//rda
		'195682',	//0.5L
		'213566',	//L
		'196861',	//life.
		'212813',	//vd
		'209251',	//dh
		'212759',	//krs
		'205251',	//wtk
		'194347',	//crc
		'206656',	//dl
		'7101',		//dr
		'109000',	//pff
        '191285'
	],
    /*
    streamsArray: [
        { displayName: 'PLCA Tv', twitchId: 'pffstream' },
        { displayName: 'ZootLive', twitchId: 'zootlive' },
        { displayName: 'LevelUp TV', twitchId: 'leveluptv' },
        { displayName: 'FaceIt TV', twitchId: 'faceittv' }
    ],*/
    
    streamsArray: [
        'pffstream','zootlive','leveluptv','faceittv'
    ],
    
    defArray: [],
    streamDefArray: [],
    tv_codes: [],
    
    timer: null,
    sek: 60,
	
    generateClans: function() {
    	$('#plca_clans').html('');
        for ( var clan in PLCA.clansArray ) {
			$('#plca_clans').append('<div id="clan_'+PLCA.clansArray[clan]+'"><div><a href="#" class="clanTag"></a>: <span class="members"></span></div><div class="clanToolTip"><h1></h1><div class="players"></div></div></div>');
		}
    },
    
    waitForSorry: function() {
		if (!document.getElementById('sorry_container')) {
			window.setTimeout(PLCA.waitForSorry, 500);
		} else {
            $('#sorry_container').html('');
            var channel_id = window.location.href.substr(window.location.href.lastIndexOf("/")+1);
            $('#sorry_container').append(PLCA.tv_codes[channel_id]);
		}
	},
    
    checkStream: function() {
        if ( PLCA.streamsArray.length > 0 ) {
            for ( var stream_id in PLCA.streamsArray ) {
				(function(stream_id){
					var channel = PLCA.streamsArray[stream_id];
					GM_xmlhttpRequest({
						method: "GET",
						url: "http://api.justin.tv/api/stream/list.json?channel="+channel+"&_="+Math.round((new Date()).getTime() / 1000),
						onload: function(response) {
							var stream = $.parseJSON(response.responseText);
							if ( stream.length > 0 ) {
								PLCA.tv_codes[channel] = stream[0].channel.embed_code.replace(/width=".*?"/,'width="100%"').replace(/height=".*?"/,'height="375"').replace(/auto_play=false/,'auto_play=true');
								$('#'+channel).show();
							}
							else {
								$('#'+channel).hide();
							}
						}
					});
				})(stream_id);
			}
		}
    },
        
    generateStreamContainers: function() {
        $('#PLCAtv').html('');
        if ( PLCA.streamsArray.length > 0 ) {
            for ( var stream_id in PLCA.streamsArray ) {
                var channel = PLCA.streamsArray[stream_id];
                $('#PLCAtv').append('<div id="'+channel+'"><a href="#!plcaTV/'+channel+'"><b>'+channel+'</b><br /> is Live! Watch!</a></div>');
                $('#'+channel).hide();
                $('#'+channel+' a').click(function(){ setTimeout(function() {PLCA.waitForSorry();}, 0); });
            }
        }
    },
    
	generateSettings: function() {
	
			$('#spon_vert').remove();
        	$('#qlv_contentChat .spon_media').remove();
			
			var settingsHTML = '<div id="PLCAtv"></div><div id="togglePLCASettings">'+
									'<img class="fleft" src="data:image/png;base64,">'+
									'<img class="fleft" src="data:image/png;base64,">'+
                                    '<span class="fleft" id="PLCAclock"></span>'+
                                    '<img class="fright" src="data:image/png;base64,">'+
                                    '<span class="fright">settings</span>'+                                        
									'<div style="clear:both"></div>'+
								'</div>'+
								'<div id="plca_settings">'+
									'<div>Alert when <select name="memberAlert"></select></div>'+
									'<div>'+
										'Clan list: <input type="text" name="clanList" id="clanList" value="'+GM_getValue('clanList',PLCA.clansArray.join(','))+'" />'+
										'<a href="#" class="cSave">save</a>'+
										'<a href="#" class="cReset">reset</a>'+
									'</div>'+
									'<div>'+
										'Stream list: <input type="text" name="streamList" id="streamList" value="'+GM_getValue('streamList',PLCA.streamsArray.join(','))+'" />'+
										'<a href="#" class="sSave">save</a>'+
										'<a href="#" class="sReset">reset</a>'+
									'</div>'+
								'</div>';
			
			$('#qlv_chatControl').before(settingsHTML);
			
        	PLCA.generateStreamContainers();
        	
            $('#togglePLCASettings img.fleft').click(function(){ setTimeout(function() {PLCA.init();}, 0); });
            $('#togglePLCASettings img.fleft').hover(
                function(){ $('#togglePLCASettings span.fleft').show()},
                function(){ $('#togglePLCASettings span.fleft').hide()}
            );
        
            $('#togglePLCASettings img.fright').click(function(){ $('#plca_settings').toggle(); });
            $('#togglePLCASettings img.fright').hover(
                function(){ $('#togglePLCASettings span.fright').show()},
                function(){ $('#togglePLCASettings span.fright').hide()}
            );
			
            $('#plca_settings select').append('<option value="0">no alert</option>');
            for ( var sOpt = 1; sOpt < 6; sOpt++ ) {
                $('#plca_settings select').append('<option value="'+sOpt+'"'+((sOpt==GM_getValue('alertVal',4))?' selected="selected"':'')+'>&gt;= '+sOpt+'</option>');
            }
			
            $('#plca_settings select').change(function(){
				setTimeout(function() {
					GM_setValue('alertVal',$('#plca_settings select').val());
					PLCA.init();
				}, 0);
            });
			
            $('#plca_settings .cReset').click(function(){
				setTimeout(function() {
					GM_setValue('clanList',PLCA.defArray.join(','));
					$('#clanList').val(PLCA.defArray.join(','));
					PLCA.clansArray = PLCA.defArray;
					PLCA.generateClans();
					PLCA.init();
				}, 0);
            });
        
            $('#plca_settings .cSave').click(function(){
				setTimeout(function() {
					GM_setValue('clanList',$('#clanList').val());
					PLCA.clansArray = $('#clanList').val().split(',');
					PLCA.generateClans();
					PLCA.init();
				}, 0);
            });
        
            $('#plca_settings .sReset').click(function(){
				setTimeout(function() {
					GM_setValue('streamList',PLCA.streamDefArray.join(','));
					$('#streamList').val(PLCA.streamDefArray.join(','));
					PLCA.streamsArray = PLCA.streamDefArray;
					PLCA.generateStreamContainers();
					PLCA.init();
				}, 0);
            });
			
            $('#plca_settings .sSave').click(function(){
				setTimeout(function() {
					GM_setValue('streamList',$('#streamList').val());
					PLCA.streamsArray = $('#streamList').val().split(',');
					PLCA.generateStreamContainers();
					PLCA.init();
				}, 0);
            });
			
			$('#qlv_chatControl').before('<div id="plca_clans"></div>');
			
	},
	
	wait: function() {
		if (!document.getElementById('spon_vert')) {
			window.setTimeout(PLCA.wait, 1000);
		} else {
            PLCA.defArray = PLCA.clansArray;
            PLCA.streamDefArray = PLCA.streamsArray;
            PLCA.clansArray = ( GM_getValue('clanList') ) ? GM_getValue('clanList').split(',') : PLCA.clansArray;
            PLCA.streamsArray = ( GM_getValue('streamList') ) ? GM_getValue('streamList').split(',') : PLCA.streamsArray;
			PLCA.generateSettings();
           	PLCA.generateClans();
            PLCA.getNews();
			PLCA.init();
		}
	},
	
    getNews: function(){
        if (!!document.getElementById('qlv_chatNewsContent')) {
            GM_xmlhttpRequest({
				method: "GET",
				url: "http://plca.pl/android.php?_="+Math.round((new Date()).getTime() / 1000),
				onload: function(response) {
                	var newsArray = $.parseJSON(response.responseText);
                	$('#qlv_chatNewsContent').append('<hr />');
                	$('#qlv_chatNews').css('height','auto');
                	var nCnt = 0;
                	for ( var news in newsArray )
                	{
                		if ( ++nCnt > 5 ) break;
                		$('#qlv_chatNewsContent').append('<a href="http://plca.pl/ql/?mod=article&view=details&no='+newsArray[news].id_article+'" target="_blank"><b>'+newsArray[news].shortDate+'</b> - '+newsArray[news].title+'</a>');
            		}
            	}
            });
        }
        else {
			window.setTimeout(PLCA.getNews, 1000);
        }
    },
	
    getMembers: function( clanObj, options ) {
		if ( !options ) return clanObj.roster || null;
		var members = [];
		for ( var m in clanObj.roster ) {
			for ( var opt in options ) {
				if ( clanObj.roster[m][opt] === options[opt] ) {
					members.push(clanObj.roster[m]);
				}
			}
		}
        return members;
	},

    zegar: function() {
        if ( --PLCA.sek < 1 ) {
            PLCA.init();
        } else {
            $('#PLCAclock').html('refresh in: '+PLCA.sek);
        }
    },
    
	init: function() {
        
        PLCA.sek = 60;
        window.clearInterval(PLCA.timer);
        PLCA.timer = self.setInterval(function(){PLCA.zegar()},1000);
		
        PLCA.checkStream();
        
        if (!!document.getElementById('plca_clans')) {
			for ( var clan in PLCA.clansArray ) {
				$('#clan_'+PLCA.clansArray[clan]+' .members').html('?');
				GM_xmlhttpRequest({
					method: "GET",
					url: "http://www.quakelive.com/clans/summary/"+PLCA.clansArray[clan]+"?_="+Math.round((new Date()).getTime() / 1000),
					onload: function(response) {
						var data = response.responseText;
						eval(data.slice(32, data.indexOf('</script>')));
						var thisMembers = PLCA.getMembers(pageData, {online: true});
						var clanId = pageData.clan.id;
						$('#clan_'+clanId+' .clanToolTip .players').html('');
						for ( var member in thisMembers ) {
							$('#clan_'+clanId+' .clanToolTip .players').append('<div>'+thisMembers[member].player_name+'</div>');
						}
                        var alertVal = GM_getValue('alertVal',4);
                		if ( thisMembers.length >= alertVal && alertVal > 0 ) {
                            $('#clan_'+clanId+' .clanTag').addClass('over4');
                        } else {
                    		$('#clan_'+clanId+' .clanTag').removeClass('over4');
                        }
						$('#clan_'+clanId+' .clanTag').html(pageData.clan.tag);
						$('#clan_'+clanId+' .clanTag').attr('href','http://www.quakelive.com/#!clans/summary/'+clanId);
						$('#clan_'+clanId+' .members').html(thisMembers.length);
						$('#clan_'+clanId+' .clanToolTip h1').html(pageData.clan.name);
					}
				});
			}
			$('#plca_clans .clanTag').hover(
				function(){	$(this).parent().next().show(); },
				function(){	$(this).parent().next().hide(); }
			);
		}
	}
}

if (typeof(unsafeWindow) !== 'undefined') {
	var $ = unsafeWindow.jQuery, quakelive = unsafeWindow.quakelive;
	$(document).ready(function() {
		PLCA.wait();
	});
} else {
	var $ = window.jQuery, quakelive = window.quakelive;
}

if (typeof GM_getValue === "undefined") {
	GM_addStyle = function(css) {
		var style = document.createElement('style');
		style.textContent = css;
		document.getElementsByTagName('head')[0].appendChild(style);
	}
}

GM_addStyle('#plca_clans { padding: 5px; text-align: left; }');
GM_addStyle('#plca_clans > div { color: #000; text-align: left; padding: 1px; display: inline-block; width: 94px; } ');
GM_addStyle('#plca_clans > div a.clanTag { color: #000; text-decoration: none; background-color: #f0f0f0; padding: 2px; display: inline-block; width: 50px; font-weight: bold; cursor: pointer; }');
GM_addStyle('#plca_clans > div a.clanTag:hover { background-color: #e0e0e0; }');
GM_addStyle('#plca_clans > div a.over4 { background-color: #c00; color: #fff; }');
GM_addStyle('#plca_clans > div a.over4:hover { background-color: #f00; color: #fff; }');
GM_addStyle('#plca_clans .clanToolTip { position: absolute; width: 180px; z-index: 999999; border: 1px solid #999; background-color: #555; padding: 5px; color: #fff; display: none; right: 0; }');
GM_addStyle('#plca_clans .clanToolTip h1 { font-size: 1.2em; }');

GM_addStyle('#plca_settings { display: none; text-align: left; clear: both; padding: 15px; border: 1px solid #000; }');
GM_addStyle('#plca_settings div, #plca_settings select { font-size: 10px; }');
GM_addStyle('#togglePLCASettings { background-color: #000; font-weight: bold; text-align: right; padding: 3px 15px }');
GM_addStyle('#togglePLCASettings span { color: #fff; padding: 0 5px; display: none; }');
GM_addStyle('#togglePLCASettings #clock { display: inline; }');
GM_addStyle('#togglePLCASettings img { cursor: pointer; }');
GM_addStyle('#togglePLCASettings .fleft { float: left; }');
GM_addStyle('#togglePLCASettings .fright { float: right; }');
GM_addStyle('#plca_settings,#togglePLCASettings { color: #000; }');
GM_addStyle('#plca_settings input { border: 1px solid #ccc; padding: 3px; font-size: 10px; }');
GM_addStyle('#plca_settings a { font-size: 10px; text-decoration: none; display: inline-block; border: 1px solid #000; background-color: #555; color: #fff; cursor: pointer; padding: 2px 10px; margin-left: 5px; }');
GM_addStyle('#plca_settings a:hover { background-color: #666; }');

GM_addStyle('#PLCAtv a { display: block; padding: 20px; color: #fff; font-size: 1.3em; text-decoration: none; background-color: #900; margin-bottom: 10px;}');